import React from 'react';
import PropTypes from 'prop-types';

// Utils
import { get } from '../api/callers';

// Components
import CasesOverview from '../components/Templates/CasesOverview';

const Home = ({ layouts }) => <CasesOverview t={console.log(layouts)} />;

Home.getInitialProps = async () => {
  const cases = get('cases/').then(resp => resp?.layouts);
  const clients = get('clients/');

  const layouts = Promise.all([cases, clients]);

  returnlayouts;
};

Home.propTypes = {
  layouts: PropTypes.arrayOf(PropTypes.object),
};

Home.defaultProps = {
  layouts: [],
};

export default Home;
